import "./App.css";

function App() {
  return (
    <main>
      <header>
        <a href="#" className="logo">
          MyBlog
        </a>
        <nav>
          <a href="#">Login</a>
          <a href="#">Register</a>
        </nav>
      </header>
      <div className="post">
        <img
          src="https://techcrunch.com/wp-content/uploads/2020/04/GettyImages-909208346.jpg?w=1390&crop=1"
          alt="postImage"
        />
      </div>
    </main>
  );
}

export default App;
